import React from "react";

function Appointment() {
  return (
    <div>
      <div style={{display: 'flex', flexDirection: 'row'}}>
        <img src="https://remedoapp.com/rweb/assets/default/images/doctor_female.svg" style={{height: '15%', width: '15%'}} />
        <div>
            <h3>Dr. A. B. C.</h3>
            <h5>MBBS, MD</h5>
            <h5>General Physician</h5>
            <h5>10 years experience</h5>
        </div>
      </div>
    </div>
  );
}

export default Appointment;
